('701500000305340', NULL, '70', 'GRAVADOR, DE CD-RW INTERNO, 48X / 24X / 48X', 'GRAVADOR, de CD-RW interno, interface EIDE, velocidades 48x / 24x / 48x para gravacao, regravacao e leitura respectivamente. \r\n- Unidade para instalacao interna. \r\n- Velocidades minimas de 48x / 24x / 48x para gravacao, regravacao e leitura respectivamente. \r\n- Interface EIDE / ATAPI. \r\n- Padrao CD-UDF (Suportar gravacao de CD-R e CD-RW). \r\n- Buffer de no minimo 2 Megabytes. \r\n- Tecnologia "buffer underrun" ou equivalente.\r\n- Drivers compativeis com Windows 98, 2000 e XP.\r\n- Acompanhar software para gravacao / duplicacao de CD com licença e midia original. - Acompanhar cabos logico e de conexao de audio. \r\n- Manual de instalacao e operacao do equipamento em portugues.', 'UN', 1, 1, 0, 224.99, 0, 'A', 'N', 0, 0, 0, 0, ' - -  '),
('701500000326216', NULL, '70', 'PLACA, MAE, MAIS PROCESSADOR, AMD DURON 1.4 GHZ', 'PLACA, mae, mais processador, kit upgrade com placa mae padrao ATX, FSB de 100 e 133 MHz, audio / video AGP / rede integrados (onboard), 3 PCI, 2 USB, suportando memorias PC100 / PC133 / PC2100 e 1 processador AMD Duron 1.4 GHz + cooler instalado na placa. \r\n- Formato ATX ou micro ATX; \r\n- 1 processador AMD Duron 1,4 GHz ou equivalente com performance nao inferior a este, instalado na placa com respectivo cooler; \r\n- BIOS atualizavel por software compativel com ACPI e PNP.; \r\n- Compatibilidade total com Windows XP.; \r\n- Capacidade de escolha do dispositivo de boot entre CD, HD e midia removivel.; \r\n- FSB de 100 e 133 MHz selecionaveis. \r\n- Minimo de 2 slots PCI 32 bits livres apos configuracao proposta.; \r\n- Minimo de 2 conectores USB integrados.; \r\n- Minimo de 1 parta serial de alta velocidade com conector DB-9.; \r\n- Minimo de 2 controladoras EIDE Ultra ATA/100 c/ 2 canais cada. \r\n- 1 controladora para disquete.; \r\n- Suportar memorias padrao PC100, PC133 e PC2100 com no minimo 2 bancos para PC 100/133 e 2 bancos para PC2100.; \r\n- Audio padrao AC97 integrado com conectores padrao PC98.; \r\n- Interface de video padrao AGP integrada com aceleracao 2D / 3D utilizando ate 32 MB de memoria compartilhada com conector VGA.; \r\n- Interface de rede Ethernet 10/100 autoselecionavel e conector RJ-45 na placa.; \r\n- Interface paralela padrao IEEE1284.; \r\n- Conectores mini-DIN para teclado e mouse no padrao PC98. \r\n- Cabos: 1 IDE 40 vias, 1 IDE 80 vias, 1 cabo de disquete.; \r\n- Manual de instalacao / configuracao em portugues.; \r\n- Drivers para todos as interfaces fornecidas em midia original.; \r\n- Garantia integral minima de 6 meses;', 'UN', 3, 3, 0, 640, 0, 'A', 'N', 0, 0, 0, 0, ' - -  '),
